const Profile = () => {
    return (
        <div className={profile.content}>
            <Avatar />
            <div>
                <NewPost/>
                <div>
                    <div>
                        post1
                    </div>
                    <div>
                        post2
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Profile;
